import React from 'react';
import { NavLink } from 'react-router-dom';
import { request, setAuthHeader } from '../helpers/axios_helper';
import { toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';

export const Navbar = () => {
    return (
      <>
      <div className="bg-sky-600 shadow-xl">
        <div className="max-w-screen-xl flex flex-wrap items-center justify-between mx-auto">
        <img className="h-20 p-2 mr-4" src={require('../pictures/gerb.png')} />
        <div className="text-white text-lg my-auto font-semibold hidden w-full md:block md:w-auto">
            <ul>
                <li  className="ml-auto md:hover:bg-red-500">
                <NavLink to="/login">Войти</NavLink>
                </li>
            </ul>
        </div>
        </div>
      </div>
      </>
    );
  };
